import React, { useEffect, useState } from 'react'
import axios from 'axios'

const App = () => {
  const [workspaces, setBikes] = useState([])

  useEffect(() => {
    const getData = async () => {
      const { data } = await axios.get('/api/workspaces')
      setBikes(data)
    }
    getData()
